import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 64.2-1910 Validity and effect of transfer.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/64.2-1910.md","filePath":"vacode/64.2-1910.md"}'),i={name:"vacode/64.2-1910.md"},o=r('<h1 id="§-64-2-1910-validity-and-effect-of-transfer" tabindex="-1">§ 64.2-1910 Validity and effect of transfer. <a class="header-anchor" href="#§-64-2-1910-validity-and-effect-of-transfer" aria-label="Permalink to &quot;§ 64.2-1910 Validity and effect of transfer.&quot;">​</a></h1><p>A. The validity of a transfer made in a manner prescribed in this chapter is not affected by:</p><ol><li><p>Failure of the transferor to comply with subsection C of § <a href="http://law.lis.virginia.gov/vacode/64.2-1908/" target="_blank" rel="noreferrer">64.2-1908</a> concerning possession and control;</p></li><li><p>Designation of an ineligible custodian, except designation of the transferor in the case of property for which the transferor is ineligible to serve as custodian under subsection A of § <a href="http://law.lis.virginia.gov/vacode/64.2-1908/" target="_blank" rel="noreferrer">64.2-1908</a>; or</p></li><li><p>Death or incapacity of a person nominated under § <a href="http://law.lis.virginia.gov/vacode/64.2-1902/" target="_blank" rel="noreferrer">64.2-1902</a> or designated under § <a href="http://law.lis.virginia.gov/vacode/64.2-1908/" target="_blank" rel="noreferrer">64.2-1908</a> as custodian or the disclaimer of the office by that person.</p></li></ol><p>B. A transfer made pursuant to § <a href="http://law.lis.virginia.gov/vacode/64.2-1908/" target="_blank" rel="noreferrer">64.2-1908</a> is irrevocable, and the custodial property is indefeasibly vested in the minor, but the custodian has all the rights, powers, duties, and authority provided in this chapter and neither the minor nor the minor&#39;s legal representative has any right, power, duty, or authority with respect to the custodial property except as provided in this chapter.</p><p>C. By making a transfer, the transferor incorporates in the disposition all the provisions of this chapter and grants to the custodian, and to any third person dealing with a person designated as custodian, the respective powers, rights, and immunities provided in this chapter.</p><p>1988, c. 516, § 31-47; 2012, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?121+ful+CHAP0614" target="_blank" rel="noreferrer">614</a>.</p>',6),n=[o];function s(d,l,c,h,p,f){return t(),a("div",null,n)}const v=e(i,[["render",s]]);export{_ as __pageData,v as default};
